import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const ModifyCar = () => {
  const navigate = useNavigate();
  const [carName, setCarName] = useState('');
  const [carData, setCarData] = useState({
    Name: '',
    Type: '',
    Make: '',
    Price: 0,
    Image: '',
    Desc: '',
    FuelType: '',
    LaunchDate: 0,
    Acceleration: '',
  });

  // Function to fetch car data based on the entered name
  const fetchCarData = async () => {
    try {
      const response = await fetch(`/api/cars/${carName}`);

      if (!response.ok) {
        throw new Error(`Error fetching car data: ${response.statusText}`);
      }

      const data = await response.json();

      if (!data) {
        throw new Error('Empty response or invalid JSON format');
      }

      setCarData(data);
    } catch (error) {
      console.error(error);
      // Handle error, e.g., display an error message to the user
    }
  };

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch(`/api/cars/modify/${carName}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(carData),
      });

      if (!response.ok) {
        throw new Error(`Error modifying car data: ${response.statusText}`);
      }

      console.log('Car data modified successfully:', carData);
      window.alert('Car details modified successfully!');
      navigate('/admin');
    } catch (error) {
      console.error(error);
      // Handle error, e.g., display an error message to the user
    }
  };

  // Function to handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setCarData((prevData) => ({ ...prevData, [name]: value }));
  };

  return (
    <div>
      <h2>Modify Car</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            Enter Car Name:
            <input
              type="text"
              value={carName}
              onChange={(e) => setCarName(e.target.value)}
              placeholder="Enter car name"
            />
          </label>
          <button type="button" onClick={fetchCarData}>
            Search
          </button>
        </div>

        {carData.Name && (
          <div>
            <label>
              Name:
              <input
                type="text"
                name="Name"
                value={carData.Name}
                onChange={handleChange}
                required
              />
            </label>
    <label>
      Type:
      <input
        type="text"
        name="Type"
        value={carData.Type}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Make:
      <input
        type="text"
        name="Make"
        value={carData.Make}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Price:
      <input
        type="number"
        name="Price"
        value={carData.Price}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Image:
      <input
        type="text"
        name="Image"
        value={carData.Image}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Description:
      <textarea
        name="Desc"
        value={carData.Desc}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Fuel:
      <input
        type="text"
        name="FuelType"
        value={carData.FuelType}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Year:
      <input
        type="text"
        name="LaunchDate"
        value={carData.LaunchDate}
        onChange={handleChange}
        required
      />
    </label>
    <label>
      Acceleration:
      <input
        type="text"
        name="Acceleration"
        value={carData.Acceleration}
        onChange={handleChange}
        required
      />
    </label>


            <button type="submit">Submit</button>
          </div>
        )}
      </form>
    </div>
  );
};

export default ModifyCar;
